  false,\n\t\"url\": null,\n\t\"notes\": \"Coastal study data as defined in FEMA Guidelines
  and Specifications, Appendix D: Guidance for Coastal Flooding Analyses and Mapping,
  submitted as a result of a coastal study. FEMA guidance documents note that a variety
  of analytical methodologies may be used to establish Base (1-percent-annual-chance)
  Flood Elevations (BFEs) and floodplains throughout coastal areas of the United States.
  The documents itemize references for the methodologies currently in use by FEMA
  for specific coastal flood hazards, provides general guidance for documentation
  of a coastal flood hazard analysis, and outlines intermediate data submissions for
  coastal flood hazard analyses with new storm surge modeling and revised stillwater
  flood level (SWFL).(Source: FEMA Guidelines and Specs, Appendix D \"Guidance for
  Coastal Flooding Analyses and Mapping\", Section D.1)\",\n\t\"license_title\": null,\n\t\"extras\":
